import React from 'react';
import ExternHeader from '../components/ExternHeader';

const AboutMe = () => {
    return (
      <>
        <ExternHeader title="about me" />

        <section className="about-short">
          <div className="about-short__container-small">
            <div className="about-short__wrapper"><div className="about-short__preview">
                </div></div>
          </div>
        </section>
      </>
    );
}

export default AboutMe;
